import { Row, Col, Container } from "reactstrap";

export default class extends React.Component {
  render() {
    const { selectDetail } = this.props;
    const { travelers }    = selectDetail;

    return (
      <Container
        style={{
          backgroundColor: "#f6f6f6",
          paddingTop: 25,
          paddingBottom: 25
        }}
      >
        <Col style={{ marginLeft: 5, marginRight: 5 }}>
          {!travelers ? [] : 
            travelers.map((item, i)=>{
              return (
                <div key={i}>
                  <Row>
                    <Col>
                      <b>{item.cabin_type}</b>
                    </Col>
                  </Row>
                  <Row style={{ marginBottom: 5 }}>
                    <Col size={3}>Name</Col>
                    <Col size={5}>{`${!item.salutation ? '' : item.salutation+'.'} ${item.first_name}  ${!item.last_name ? '' : item.last_name } `}</Col>
                  </Row>
                  {/* {item.cabin_type.toLowerCase()==="adult" ? 
                    <Row style={{ marginBottom: 5 }}>
                      <Col size={3}>Email</Col>
                      <Col size={5}>{`${!item.email ? '-' : item.email}`}</Col>
                    </Row>
                   : []
                  } */}
                  <Row style={{ marginBottom: 5 }}>
                    <Col size={3}>Phone Number</Col>
                    <Col size={5}>{`${item.mobileNoPrefix ? '+'+dataProfile.mobileNoPrefix : '-'} ${!item.mobile_no ? '' : `+${item.mobile_no}`}`}</Col>
                  </Row>
                  <Row style={{ marginBottom: 5 }}>
                    <Col size={3}>Airlines</Col>
                    <Col size={5}>{selectDetail===null ? '0' : selectDetail.airline}</Col>
                  </Row>
                  <Row style={{ marginBottom: 5 }}>
                    <Col size={3}>Transaction</Col>
                    <Col size={5}>{selectDetail===null ? '0' : selectDetail.source}</Col>
